import React from 'react';

export const FilmList = ({ nameList }) => {
  const { name, films } = nameList;

  return (
    <div className="text-yellow-500 font-bold">
      <h1>{name}</h1>
      {films.map(item => {
        return <li key={item}>{item}</li>;
      })}
    </div>
  );
};
